\n</ul>','<ul>\r\n<li>1 person covered</li>\r\n<li>Aged between 5 to 29 years &nbsp;</li>\r\n<li>Valid for 6 months from the date of registration &nbsp;</li>\r\n<li>Schedules and other details of mental health consultation and career counselling sessions will be shared on our social channels &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li>\r\n<li>Discounts on admission &amp; tuition fees and books &amp; educational items can be availed at Chhaya<sup>TM</sup>partner institutes and outlets only &nbsp;</li>\r\n<li>Risks of Hospital Cash Coverage, Accidental Coverage, Covid-19 Coverage and Life Coverage will be underwritten by Chartered Life Insurance Company Ltd &nbsp;</li>\r\n</ul>','<p>Terms and Conditions:</p>\r\n<ul>\r\n<li>15 days waiting period after registration will be applied for Hospital Cash Coverage, Accidental Coverage and Covid-19 Coverage</li>\r\n<li>7 days waiting period after registration will be applied for Life Coverage &nbsp;&nbsp;</li>\r\n<li>Minimum 24 hours of hospitalization is needed for Hospital Cash Coverage eligibility &nbsp;</li>\r\n<li>Maximum 3 nights of hospitalization at a stretch is covered under Hospital Cash Coverage</li>\r\n<li>Taka 1,000 can be claimed for each night of hospitalization under Hospital Cash Coverage &nbsp;&nbsp;&nbsp;</li>\r\n<li>A Covid-19 positive report followed by recommendation of isolation by a physician are prerequisites for claiming Covid-19 coverage</li>\r\n<li>The Covid-19 Coverage is inclusive of the sum value of Hospital Cash Coverage</li>\r\n<li>All medical prescriptions must be prescribed by BMDC registered doctors</li>\r\n<li>The scheduled benefits covered under Accidental Coverage are as follows: &nbsp;</li>\r\n</ul>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"66\">\r\n<p><strong>SL. </strong></p>\r\n</td>\r\n<td width=\"194\">\r\n<p><strong>Types of Accidental Hospitalization </strong></p>\r\n</td>\r\n<td width=\"157\">\r\n<p><strong>Description of Disabilities due to Accident </strong></p>\r\n</td>\r\n<td width=\"157\">\r\n<p><strong>Amount of Coverage (BDT) </strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"194\">\r\n<p>Head Injuries</p>\r\n</td>\r\n<td width=\"157\">\r\n<p>Severe collision impacts can cause a closed head injury. In that situation, the fluid and tissue inside the skull are damaged because of the sudden movement or impact of the head. Less severe closed head injuries often result in concussions, while the most severe impacts can cause brain damage.</p>\r\n</td>\r\n<td width=\"157\">\r\n<p>100% of Sum-assured</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>2</p>\r\n</td>\r\n<td width=\"194\">\r\n<p>2nd &amp; 3rd Degree Burn</p>\r\n</td>\r\n<td width=\"157\">\r\n<p>Second-degree (partial thickness) burns. Second-degree burns involve the epidermis and part of the lower layer of skin, the dermis. The burn site looks red, blistered, and may be swollen and painful.</p>\r\n<p>Third-degree (full thickness) burns. Third-degree burns destroy the epidermis and dermis. They may go into the innermost layer of skin, the subcutaneous tissue. The burn site may look white or blackened and charred.</p>\r\n</td>\r\n<td width=\"157\">\r\n<p>75% of Sum-assured</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>3</p>\r\n</td>\r\n<td width=\"194\">\r\n<p>Chest Injuries</p>\r\n</td>\r\n<td width=\"157\">\r\n<p>These injuries can be more severe such as broken ribs or internal injuries. Drivers often experience chest injuries because of their position which allows very little freedom of movement</p>\r\n</td>\r\n<td width=\"157\">\r\n<p>50% of Sum-assured</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>4</p>\r\n</td>\r\n<td width=\"194\">\r\n<p>Fractures, Dislocation, Scrapes and Cuts</p>\r\n</td>\r\n<td width=\"157\">\r\n<p>Depending on the nature of the collision, injuries might be mere bruises or scrapes, but even breaks can occur.</p>\r\n</td>\r\n<td width=\"157\">\r\n<p>25% of Sum-assured</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>5</p>\r\n</td>\r\n<td width=\"194\">\r\n<p>1st degree burn &amp; scrapes &amp; cut</p>\r\n</td>\r\n<td width=\"157\">\r\n<p>A soft tissue injury/burn is damage to the body&rsquo;s connective tissue, which means muscles, ligaments and tendons. First-degree burns affect only the outer layer of skin, the epidermis.</p>\r\n</td>\r\n<td width=\"157\">\r\n<p>10% of Sum-assured</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','<p>Exclusion Clauses:</p>\r\n<ul>\r\n<li>All pre-existing diseases are excluded;</li>\r\n<li>Immunization procedures; &nbsp;</li>\r\n<li>Treatment of family planning purposes including termination of pregnancy, ectopic pregnancy, abortion, sterility or treatment related to assisted reproduction, cost of contraception, cost of female hygiene product like sanitary pads, etc.;</li>\r\n<li>Mental, emotional or psychiatric disorders, alcoholism or any other narcotic addiction; &nbsp;&nbsp;</li>\r\n<li>Obesity i.e., treatment for, or required as a result of obesity, any cosmetic or plastic treatment/surgery, unless required as reconstructive surgery as a consequence of an injury due to accidents, burns;</li>\r\n<li>Any procedures which is experimental or not generally accepted by the medical profession viz. acupuncture, herbal/ayurvedic/homeopathy treatment and any Alternative Medical Care (AMC) etc.;</li>\r\n<li>Rest, convalescence or rejuvenation cures, thermal baths, physiotherapy or confinement for the purposes of slimming or beautification;</li>\r\n<li>Injury arising due to accident while participating in any unlawful activities (e.g., driving a car without a license), attempted suicide, violation or attempted violation of the law, injuries willfully or intentionally self-inflicted or due to insanity or under the influence of a drug;</li>\r\n<li>Routine examination of eye and ear, fitting or replacement of eyeglasses (including Intra-ocular lens or contact lenses) or hearing aids, health screening including routine physical examinations (health check-ups) and any dental treatment unless require hospitalization for re-constructive surgery as a consequence of an accident;</li>\r\n<li>Non-surgical care for tuberculosis, hepatitis B &amp; C and any other vaccinations, all expenses incurred in connection with the donor for any treatment, AIDS and HIV diseases and costs of prostheses, corrective devices;</li>\r\n<li>Sleep disorders i.e., treatment for insomnia, sleep apnoea, snoring, or any other sleep related breathing problem;</li>\r\n<li>Assembly of artificial limbs &amp; necessary treatment of the said artificial limbs unless required due to accident; &nbsp;</li>\r\n<li>Death due to HIV/AIDS, suicide and unlawful activities (for Life Coverage). &nbsp;</li>\r\n</ul>','21,22,23,24,25,26,27,28,29',3,0,'a:2:{i:0;a:2:{s:16:\"number_of_people\";s:1:\"1\";s:5:\"price\";s:3:\"199\";}i:1;a:2:{s:16:\"number_of_people\";N;s:5:\"price\";N;}}',0,1),(9,'Edu Chhaya Gold','1605989642-42179327.jpg','1605989642-28956846.jpg','<ul>\r\n<li>Student Consultation &amp; Counselling &nbsp;&nbsp;</li>\r\n<li>Education Discount</li>\r\n<li>Cash Coverage up to Taka 50,000 (including Covid-19) &nbsp;</li>\r\n<li>Duration: 6 months</li>\r\n<li>Price: Taka 365</li>\r\n</ul>','<ul>\r\n<li>1 person covered</li>\r\n<li>Aged between 5 to 29 years &nbsp;</li>\r\n<li>Valid for 6 months from the date of registration &nbsp;</li>\r\n<li>Schedules and other details of mental health consultation and career counselling sessions will be shared on our social channels &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li>\r\n<li>Discounts on admission &amp; tuition fees and books &amp; educational items can be availed at Chhaya<sup>TM</sup>partner institutes and outlets only &nbsp;</li>\r\n<li>Risks of Hospital Cash Coverage, Accidental Coverage, Covid-19 Coverage and Life Coverage will be underwritten by Chartered Life Insurance Company Ltd &nbsp;</li>\r\n</ul>','<p>Terms and Conditions:</p>\r\n<ul>\r\n<li>15 days waiting period after regist